<div class="post-1576 post type-post status-publish format-standard hentry category-sprawy-klubowe category-wydarzenia" id="post-1576">
<div class="post_top">
<div class="post_title">
<h2><a href="http://ikarmielec.org.pl/?p=1576" rel="bookmark" title="Permanent Link to Nadzwyczajne Walne Zebranie Sprawozdawczo &#8211; Wyborcze 20.06.2018">Nadzwyczajne Walne Zebranie Sprawozdawczo &#8211; Wyborcze 20.06.2018</a></h2>
</div>
<div class="post_top_data">
<p class="post_author">Napisany przez <span>admin</span>  |  Dodany 13-06-2018</p>
<p class="post_cats">Kategoria : <span><a href="http://ikarmielec.org.pl/?cat=7" rel="category">Sprawy klubowe</a>, <a href="http://ikarmielec.org.pl/?cat=6" rel="category">Wydarzenia</a></span></p>
</div>
</div>
<div class="entry">
<div class="content">
<p><img class="wp-image-1208 aligncenter" src="http://ikarmielec.org.pl/wp-content/uploads/2014/06/ikar-logo-300x232.png" alt="" width="182" height="141" srcset="http://ikarmielec.org.pl/wp-content/uploads/2014/06/ikar-logo-300x232.png 300w, http://ikarmielec.org.pl/wp-content/uploads/2014/06/ikar-logo-64x50.png 64w, http://ikarmielec.org.pl/wp-content/uploads/2014/06/ikar-logo.png 527w" sizes="(max-width: 182px) 100vw, 182px" /></p>
<p>&nbsp;</p>
<h3 style="text-align: center;"><strong>Z A P R O S Z E N I E</strong></h3>
<p style="text-align: center;">Zarzad <strong>Miedzyszkolnego Klubu Sportowego &#8222;Ikar&#8221; Mielec,</strong> zaprasza rodzicow czlonkow klubu , pelnoletnich czlonkow klubu oraz sympatykow sportu plywackiego na</p>
<p style="text-align: center;"><strong>Nadzwyczajne Walne Zebranie Sprawozdawczo &#8211; Wyborcze</strong></p>
<p>ktore odbedzie sie w dniu <strong>20 czerwca (sroda) 2018 r. w Szkole Podstawowej nr 6 w Mielcu sala nr 17 o godz. 17.00 ( I termin) , 17.15 (II termin)</strong></p>
<p>&nbsp;</p>
<p style="text-align: center;"><strong><em>Drodzy rodzice i przyjaciele sportu plywackiego !!</em></strong><br />
Serdecznie zapraszamy na Walne Zebranie wszystkich chetnych, a zwlaszcza rodzicow dzieci bedacych naszymi podopiecznymi. Oprocz standardowego wymaganego statutem i przepisami, przedstawionego ponizej planu Zebrania, bedziemy chcieli omowic kierunki rozwoju naszego klubu oraz pozyskac do czynnego udzialu w zyciu Klubu wszystkich chetnych wolontariuszy. Serdecznie i goraco zapraszamy ! Przyszlosc waszych dzieci zalezy od Was samych !</p>
<p>W planie Zebrania:</p>
<ul>
<li style="text-align: left;">Zatwierdzenie sprawozdania finansowego za rok 2017</li>
<li style="text-align: left;">Zatwierdzenie sprawozdania z dzialalnosci klubu za rok 2017</li>
<li style="text-align: left;">Sprawozdanie Komisji Rewizyjnej &#8211; Informacja na temat dzialalnosci sportowej i organizacyjnej klubu za rok 2017</li>
<li style="text-align: left;">Wybory Nowych Wladz Klubu</li>
</ul>
<p style="text-align: right;">Zarzad MKS Ikar Mielec</p>
<p><a href="http://www.ikarmielec.org.pl/pliki/zebranie.pdf">Do pobrania (pdf)</a></p>
<div class="fixed"></div>
</div>
</div>
</div>


<div class="post-1562 post type-post status-publish format-standard hentry category-sprawy-klubowe" id="post-1562">
<div class="post_top">
<div class="post_title">
<h2><a href="http://ikarmielec.org.pl/?p=1562" rel="bookmark" title="Permanent Link to Powolania do Reprezentacji Narodowej dla mieleckich plywakow">Powolania do Reprezentacji Narodowej dla mieleckich plywakow</a></h2>
</div>
<div class="post_top_data">
<p class="post_author">Napisany przez <span>admin</span>  |  Dodany 07-02-2018</p>
<p class="post_cats">Kategoria : <span><a href="http://ikarmielec.org.pl/?cat=7" rel="category">Sprawy klubowe</a></span></p>
</div>
</div>
<div class="entry">
<div class="content">
<p><a href="http://ikarmielec.org.pl/wp-content/uploads/2018/02/foto1.jpg"><img class="size-medium wp-image-1563 alignleft" src="http://ikarmielec.org.pl/wp-content/uploads/2018/02/foto1-300x225.jpg" alt="" width="300" height="225" srcset="http://ikarmielec.org.pl/wp-content/uploads/2018/02/foto1-300x225.jpg 300w, http://ikarmielec.org.pl/wp-content/uploads/2018/02/foto1-768x576.jpg 768w, http://ikarmielec.org.pl/wp-content/uploads/2018/02/foto1-1024x768.jpg 1024w" sizes="(max-width: 300px) 100vw, 300px" /></a></p>
<p>Dwaj plywacy MKS ?Ikar? Mielec osiemnastoletni Maksymilian Cerlich i szesnastoletni  Dawid Ksiaznicki zostali powolani do reprezentacji Polski juniorow na Miedzynarodowy Wielomecz                     z udzialem reprezentacji : Austrii, Brazylii,  Bulgarii, Cypru, Grecji, Izraela, Portugalii, Slowenii, Szwajcarii, Turcji, Ukrainy i Polski,  ktory rozegrany zostanie w dniach 24-25 marca br.</p>
<p>Pierwszy z nich gdzie barwy Naszego Kraju bedzie reprezentowal Maksymilian Cerlich odbedzie sie  w Gratzu w Austrii, a z udzialem Dawida Ksiaznickiego w Limassol na Cyprze.</p>
<p>Powolanie zawodnikow ?Ikara? Mielec to efekt ich bardzo dobrej postawy na Glownych Mistrzostwach Polski w plywaniu rozegranych w Lodzi w grudniu ur. Maks uzyskala najlepszy wynik na 200 m stylem zmiennym sposrod juniorow 18-letnich, a Dawid uzyskal najlepszy wynik w kategorii juniorow 16-letnich na 200 m stylem klasycznym. Powolanie otrzymal takze ich trener Bogdan Omiotek, ktory pojedzie z kadra polskich juniorow do Limassol.</p>
<div class="fixed"></div>
</div>
</div>
</div>


<div class="post-1559 post type-post status-publish format-standard hentry category-zawody" id="post-1559">
<div class="post_top">
<div class="post_title">
<h2><a href="http://ikarmielec.org.pl/?p=1559" rel="bookmark" title="Permanent Link to Zawody o Puchar Prezydenta Mielca 24.02.2018">Zawody o Puchar Prezydenta Mielca 24.02.2018</a></h2>
</div>
<div class="post_top_data">
<p class="post_author">Napisany przez <span>admin</span>  |  Dodany 24-01-2018</p>
<p class="post_cats">Kategoria : <span><a href="http://ikarmielec.org.pl/?cat=5" rel="category">Zawody</a></span></p>
</div>
</div>
