<div class="post-1473 post type-post status-publish format-standard hentry category-wydarzenia category-zawody" id="post-1473">
<div class="post_top">
<div class="post_title">
<h2><a href="http://ikarmielec.org.pl/?p=1473" rel="bookmark" title="Permanent Link to Maksymilian Cerlich Mistrzem Polski Juniorow 16 lat w plywaniu na 100 m stylem zmiennym">Maksymilian Cerlich Mistrzem Polski Juniorow 16 lat w plywaniu na 100 m stylem zmiennym</a></h2>
</div>
<div class="post_top_data">
<p class="post_author">Napisany przez <span>admin</span>  |  Dodany 16-03-2016</p>
<p class="post_cats">Kategoria : <span><a href="http://ikarmielec.org.pl/?cat=6" rel="category">Wydarzenia</a>, <a href="http://ikarmielec.org.pl/?cat=5" rel="category">Zawody</a></span></p>
</div>
</div>
<div class="entry">
<div class="content">
<p><strong><em><u><img class="size-medium wp-image-1476 alignleft" src="http://ikarmielec.org.pl/wp-content/uploads/2016/03/64833_466615456882406_2997914650825802186_n-300x200.jpg" alt="64833_466615456882406_2997914650825802186_n" width="300" height="200" srcset="http://ikarmielec.org.pl/wp-content/uploads/2016/03/64833_466615456882406_2997914650825802186_n-300x200.jpg 300w, http://ikarmielec.org.pl/wp-content/uploads/2016/03/64833_466615456882406_2997914650825802186_n-768x512.jpg 768w, http://ikarmielec.org.pl/wp-content/uploads/2016/03/64833_466615456882406_2997914650825802186_n.jpg 960w" sizes="(max-width: 300px) 100vw, 300px" />Trzy medale w mistrzostwach Polski  juniorow  w plywaniu wywalczyli plywacy Ikara Mielec.          </u></em></strong></p>
<p><strong><u>Maksymilian Cerlich</u> zostal mistrzem Polski juniorow 16-letnich w plywaniu na dystansie 100 m stylem zmiennym i brazowym medalista na 200 m stylem zmiennym.                                                                                                                                                     <u>Andrea Litwin</u> wywalczyla medal brazowy w kategorii juniorek 15-letnich na 200 m stylem motylkowym.</strong></p>
<p>W dniach 11 do 13 marca odbyly sie w Gliwicach zimowe mistrzostwa Polski juniorow 16-letnich w plywaniu.  <strong>Maksymilian Cerlich </strong>w wyscigu na dystansie 100 m stylem zmiennym wywalczyl tytul <strong>mistrza Polski</strong>, a na 200 m tym samym stylem zdobyl <strong>medal brazowy</strong>. Maksymilian zajal takze czwarte miejsce na 200 m stylem dowolnym,  byl szosty na 400 m stylem zmiennym oraz siodmy na 100 m stylem dowolnym.</p>
<p><strong><em>Juniorzy 15 &#8211; letni swoje mistrzostwa Polski rozegrali tydzien wczesniej  w Gorzowie Wielkopolskim   / w dniach 4 &#8211; 6 marca/.                                  </em>                                                                                               Andrea Litwin</strong> wywalczyla <strong>brazowy medal</strong> na 200 m stylem motylkowym oraz byla szosta na dystansie 100 m tym samym stylem, dziewiata na 200 m stylem zmiennym, dwunasta na 100 m tym samym stylem i czternasta na 50 m stylem motylkowym. <strong>Mikolaj Malec </strong>byl czwarty na 200 m stylem grzbietowym , szosty na 100 m tym samym stylem  oraz trzy razy zajal dziesiate miejsce: na 200 m stylem motylkowym, na 50 m stylem grzbietowym i 200 m stylem zmiennym</p>
<p>W  mistrzostw Polski juniorow 16 &#8211; letnich w finalach -A- plywala                                                                                                                                                                         <strong>Kinga Niziolek</strong>  zajmujac  szoste miejsce na 200 m stylem motylkowym, oraz dziesiate miejsce na  400 m stylem zmiennym,. Kinga byla takze czternasta na 100 m stylem motylkowym i  szesnasta na 200 m stylem zmiennym.<strong> Mariusz Data</strong> zajal dwukrotnie 19 miejsce  w wyscigach na 100 i 200 m stylem klasycznym.      W mistrzostwach startowala rowniez Daria Piekarz  i Eliza Swol.</p>
<p><strong><em>Juniorzy 14 &#8211; letni swoje mistrzostwa Polski rozegrali w Olsztynie  /w dniach 4 &#8211; 6 marca/.</em>        </strong></p>
<p>W finale  -A- walczyl<strong> Dawid Ksiaznicki</strong> zajal czwarte miejsce na 100 m stylem klasycznym, piate miejsce na 400 m stylem zmiennym , szoste na 200 m stylem klasycznym,  dziewiate na 200 m stylem zmiennym. <strong>Oliwia Strugala</strong> zajela dziesiate miejsce na 50 m stylem motylkowym<em>.</em>                                                                                                                                                                                                                                                                            W finalach -B- plywali:<strong> Oliwia Cerlich</strong> &#8211; zajela jedenaste miejsce na 800 m stylem dowolnym, trzynaste miejsce na 200 m i szesnaste na 400 m tym samym stylem oraz<strong> Patryk Magda &#8211;</strong> zajal pietnaste miejsce na 200 m stylem motylkowym.  W zawodach udzial wzieli takze Gabriel Berezak, Bartlomiej Krezel,  Mikolaj Kuzdzal, Krystian Labak, Marcelina Madycka i Patrycja Szydlowska, ktorzy poprawili swoje rekordy zyciowe.<em>   </em><strong>     </strong></p>
<p>Wymienieni zawodnicy to uczniowie Gimnazjum nr II w Mielcu.</p>
<p>Dawid Ksiaznicki to wychowanek trener Joanny Rusek, a Maksymilian Cerlich, Andrea Litwin, Kinga Niziolek i Mikolaj Malec trenera Roberta Wieczorka, obecnie trenerem jest Boguslaw Omiotek.</p>
<p>Gratulujemy.</p>
